var InitializeJS=function(window,document){function allElements(){var e,n=document.querySelectorAll("[data-initialize]");for(e=0;e<n.length;e++)element(n[e])}function element(el){for(var components=el.getAttribute("data-initialize").split(" "),n=0;n<components.length;n++)try{new(eval(components[n]))(el)}catch(error){console.warn("initialize.js::warn "+error)}}return{element:element,allElements:allElements}}(window,document);